import React, { useState } from 'react';
import axios from 'axios';
import './CreateStudent.css'; // Optional styling

function CreateStudent() {
  const [studentData, setStudentData] = useState({
    studentId: '',
    name: '',
    contactNumber: '',
    program: '',
    year: '',
  });
  const [message, setMessage] = useState('');

  const handleSubmit = (event) => {
    event.preventDefault();

    axios.post('/students/createStudent', studentData)
      .then(response => {
        setMessage('Student created successfully!');
        setStudentData({
          studentId: '',
          name: '',
          contactNumber: '',
          program: '',
          year: '',
        });
      })
      .catch(error => {
        setMessage('Error creating student');
        console.error(error);
      });
  };

  return (
    <div className="create-student-container">
      <h2>Create Student</h2>
      <form onSubmit={handleSubmit}>
        <label>Name:</label>
        <input
          type="text"
          placeholder="Enter Name"
          value={studentData.name}
          onChange={(e) => setStudentData({ ...studentData, name: e.target.value })}
          required
        />
        <label>Contact Number:</label>
        <input
          type="tel"
          placeholder="Enter Contact Number"
          value={studentData.contactNumber}
          onChange={(e) => setStudentData({ ...studentData, contactNumber: e.target.value })}
          required
        />
        <label>Program:</label>
        <input
          type="text"
          placeholder="Enter Program"
          value={studentData.program}
          onChange={(e) => setStudentData({ ...studentData, program: e.target.value })}
          required
        />
        <label>Year:</label>
        <input
          type="number"
          placeholder="Enter Year"
          value={studentData.year}
          onChange={(e) => setStudentData({ ...studentData, year: e.target.value })}
          required
        />
        <button type="submit" className="submit-button">Create Student</button>
      </form>
      {message && <p className="message">{message}</p>}
    </div>
  );
}

export default CreateStudent;
